<h1 class="title toc-ignore">Pot hanger</h1>

</div>


<p>Just another simple woodworking project to enhance our tiny apartment. Our limited cupboard-space mixed with a love for food made pan storage a necessity. I constructed the frame out of pine with a steel rod for hanger support. It can hold a lot and has been for years!</p>
